	//Menu Principal
	window.onscroll = function() {myFunctionScrollMenu()};

	function myFunctionScrollMenu() {

	  if (document.documentElement.scrollTop > 50) {
		document.getElementById("menu-principal").classList.remove("inicial");
		document.getElementById("menu-principal").classList.add("rolagem");
		if(elementExists = document.getElementById("rolar-mouse")) {
			document.getElementById("rolar-mouse").classList.add("ocultar");
		}

	  } else {
		document.getElementById("menu-principal").classList.add("inicial");
		document.getElementById("menu-principal").classList.remove("rolagem");
		if(elementExists = document.getElementById("rolar-mouse")) {
			document.getElementById("rolar-mouse").classList.remove("ocultar");
		}
	  }
	}
	
	jQuery(function($){
		
		//Language
		var lang = $("html").attr("lang");
		$("body").addClass(lang);
		
		$(".translate .wpml-ls-current-language a").on("click", function() { return false; });
		
		$("#hero-mobile").addClass('ativo').removeClass('inicio delay');
		
		// Função Scroll
		$(window).scroll(function() {
		   var windscroll = $(window).scrollTop();

		   $('.animate-scroll').each(function(i) {

			  var $section = $(this);

			  //Adicionamos uma classe inicial para que os elementos ocultos não fiquem invisiveis no Divi 
			  $section.addClass('inicio delay');

			  //var limite = $section.is("#hero-mobile") ? + 5 : ($(window).height() / 3 );
			  var limite = ($(window).height() / 3 );

			   var limitetopo = ($section.hasClass('mobile')) ? $section.offset().top - limite : $section.position().top - limite;

			  if (limitetopo <= windscroll) {
				 $('.animate-scroll.mobile').removeClass('ativo').addClass('delay');
				 $section.addClass('ativo').removeClass('delay');
			  } else {
				 $section.removeClass('ativo').addClass('delay');
			  }

		   });

		}).scroll();
	});;
